const validateInput = () => {
  if (input.value.length === 0) {
    p.style.backgroundColor = 'rgb(255, 0, 0, 0.9)';
    p.textContent = 'Input can\'t be empty.';
    input.focus();
  } else {
    const { value } = input;
    displayData(value);
    p.style.backgroundColor = 'unset';
    p.textContent = '';
    input.value = '';
  }
};

